"""### Spectogram"""

def plot_spectrogram_scipy(
        signal,
        sample_rate = SAMPLE_RATE,
        hydrophone_sensitivity = HYDROPHONE_SENSITIVITY,
        title=None,
        with_colorbar=True,
        width=None,
        epsilon = 1e-16,
    ):

    # Compute spectrogram:
    w = scipy.signal.get_window('hann', sample_rate)
    f, t, psd = scipy.signal.spectrogram(
        signal,
        sample_rate,
        nperseg=sample_rate,
        noverlap=0,
        window=w,
        nfft=sample_rate,
    )
    psd = 10*np.log10(psd+epsilon) - hydrophone_sensitivity

    # Plot spectrogram:
    fig = plt.figure(figsize=(width, round(width/3))) if width else None
    plt.imshow(
        psd,
        aspect='auto',
        origin='lower',
        vmin=30,
        vmax=90,
        cmap='Blues',
    )
    plt.yscale('log')
    y_max = sample_rate / 2
    plt.ylim(10, y_max)

    if with_colorbar:
        plt.colorbar()

    plt.xlabel('Seconds')
    plt.ylabel('Frequency (Hz)')
    plt.title(
        title or \
        f'Calibrated spectrum levels, 16 {sample_rate / 1000.0} kHz data'
    )



