def play_section(signal, start=0, stop=-1, seconds=None, rate=sample_rate):
    if start > len(signal):
        print("Start sample count too large! Must be < ", len(signal))
        return signal

    start_sample = start * rate

    if seconds:
        stop_sample = start_sample + seconds * rate

    else:
        stop_sample = stop

    section = signal[start_sample:stop_sample]

    print("Playing section of size", section.shape)

    return display(Audio(section, rate=rate, autoplay=True))


