"""## Resample

Since we need to sync out signal sample rate with what the model expects.
"""

def resample(
        signal,
        sample_rate = sample_rate,
        target_rate = MODEL_SAMPLE_RATE,
        scale=True
    ):
    # Now, resample our 16 kHz segment as the model expects 10 kHz audio:
    print(f'==> Resampling to {target_rate} Hz...')
    resampled_signal = librosa.resample(
        signal,
        orig_sr=sample_rate,
        target_sr=target_rate,
        scale=scale  # "Scale the resampled signal so that y and y_hat have approximately equal total energy"
    )

    # At 10 kHz, this is the nominal size in samples of our desired segment
    # when resampled:
    original_signal_seconds = signal.shape[0] / sample_rate
    print(f"Original signal seconds: {original_signal_seconds}")

    resampled_signal_samples = round(target_rate * original_signal_seconds)
    print(f"Resampled signal's sample count: {resampled_signal_samples}")

    # Note that resampled_signal could be a bit larger.
    # Do the adjustment so it is our desired segment duration:
    return resampled_signal[:resampled_signal_samples]


