"""### Run model"""

def run(
        signal_10kHz,
        score_fn=score_fn,
        context_step_samples=MODEL_SAMPLE_RATE,
    ):
    start = time.time()

    # We specify a 1-sec score resolution:
    context_step_samples = tf.cast(context_step_samples, tf.int64)

    print(f'\n==> Applying model ...')
    print(f'   inital input: len(signal_10kHz) = {len(signal_10kHz)}')

    waveform1 = np.expand_dims(signal_10kHz, axis=1)
    waveform_exp = tf.expand_dims(waveform1, 0)  # makes a batch of size 1
    print("     final input: waveform_exp.shape = ", waveform_exp.shape)

    signal_scores = score_fn(
        waveform=waveform_exp,
        context_step_samples=context_step_samples
    )
    score_values = signal_scores['scores'].numpy()[0]
    print(f'==> Model applied.  Obtained score_values = {len(score_values)}')
    print(f'==> Elapsed time: {time.time() - start}')

    return score_values


