"""I don't think measuring only an energy over a certrain threshold for a window is going to cut it here.
There are a lot of reasons a sound signal may have high energy, and such a filter would pick up a lot of noise.
"""

import numpy as np
from scipy.signal import find_peaks
from scipy.signal import butter, lfilter, find_peaks, sosfilt

def energy_based_detection(
        signal,
        sample_rate=sample_rate,
        window_size=1024,
        threshold=0.1
    ):
    # Calculate energy in windows
    energy = np.array([
        sum(abs(signal[i:i+window_size]**2))
        for i in range(0, len(signal), window_size)
    ])

    # Normalize energy
    energy = energy / np.max(energy)

    # Find peaks above threshold
    peaks, _ = find_peaks(energy, height=threshold)

    # Convert peak indices to time
    peak_times = peaks * (window_size / sample_rate)

    return peak_times

detected_sections = energy_based_detection(sample_signal)
print(f"Detected {len(detected_sections)} potential whale sounds from energy")

"""Whale vocalization frquency ranges can be seen in the spectrogram above.
We should find highcut and lowcut values within these ranges: $\in [50, 1500]$.




More on Butterworth filtering here: https://en.wikipedia.org/wiki/Butterworth_filter
"""

def butter_bandpass(lowcut, highcut, fs, order=5):
    nyq = 0.5 * fs
    low = lowcut / nyq
    high = highcut / nyq
    # b, a = butter(order, [low, high], btype='band')
    sos = butter(order, [low, high], btype='band', output="sos")
    # return b, a
    return sos


def frequency_based_detection(
        signal,
        sample_rate=sample_rate,
        lowcut=200,
        highcut=1500,
        window_size=512,
        threshold=0.015,
        order=5,
    ):
    # Apply bandpass filter
    # b, a = butter_bandpass(lowcut, highcut, sample_rate, order)
    sos = butter_bandpass(lowcut, highcut, sample_rate, order)
    # filtered_signal = lfilter(b, a, signal)
    filtered_signal = sosfilt(sos, signal)

    # Calculate energy in windows
    energy = np.array([
        sum(abs(filtered_signal[i:i+window_size]**2))
        for i in range(0, len(filtered_signal), window_size)
    ])

    # Normalize energy
    energy = energy / np.max(energy)

    # Find peaks above threshold
    peaks, _ = find_peaks(energy, height=threshold)

    # Convert peak indices to time
    peak_times = peaks * (window_size / sample_rate)

    return peak_times


