def seconds_to_flags(seconds, sample_rate=sample_rate):
    return np.array([int(s*sample_rate) for s in seconds])

def parse_detect(
        signal,
        sample_rate=sample_rate,
        seconds=30,
        start_seconds=300,
        lowcut=50,
        highcut=500,
        window_size=1024,
        energy_threshold=0.99,
        threshold=0.1,
        play=False,
        plot=False,
        timer=True,
        order=5,
    ):
    timer_start = time.time() if timer else None

    (
        sample_start,
        sample_stop,
        sample_signal
    ) = parse_signal(
        signal=signal,
        start_second = start_seconds,
        seconds = seconds,
        sample_rate = sample_rate,
    )
    if play:
        play_section(signal, start=start_seconds, seconds=seconds)

    detected_energy_seconds = energy_based_detection(
        sample_signal,
        sample_rate,
        window_size,
        energy_threshold,
    ) if energy_threshold < 1 else []

    detected_frequency_seconds = frequency_based_detection(
        sample_signal,
        sample_rate,
        lowcut,
        highcut,
        window_size,
        threshold,
        order,
    )

    detected_energy_flags = seconds_to_flags(detected_energy_seconds, sample_rate)
    detected_frequency_flags = seconds_to_flags(detected_frequency_seconds, sample_rate)

    print(f"Detected {len(detected_energy_seconds)} potential whale sounds from energy")
    print(f"Detected {len(detected_frequency_seconds)} potential whale sounds from frequency")

    if plot:
        figure = plt.figure(figsize=(24, 8))
        plt.title(
            "Detections - Params: " + ", ".join([
                f"lowcut={lowcut}",
                f"highcut={highcut}",
                f"window_size={window_size}",
                f"threshold={threshold}",
                f"energy_threshold={energy_threshold}",
            ])
        )
        plt.plot(sample_signal)

        if len(detected_frequency_flags):
            # plt.vlines(detected_frequency_flags, min(sample_signal), max(sample_signal), colors='y')
            for detected_frequency_flag in detected_frequency_flags:
                plt.axvspan(
                    detected_frequency_flag - round(window_size/2),
                    detected_frequency_flag + round(window_size/2),
                    alpha=0.9,
                    color='y',
                    zorder=10, # bring to front
                )

        if len(detected_energy_flags):
            # plt.plot(detected_energy_flags, sample_signal[detected_energy_flags], 'rh')
            for detected_energy_flag in detected_energy_flags:
                plt.axvspan(
                    detected_energy_flag - round(window_size/2),
                    detected_energy_flag + round(window_size/2),
                    alpha=0.5,
                    color='r',
                    zorder=5, # keep in middle
                )
            plt.legend(['signal', 'energy', 'frequency'])
        else:
            plt.legend(['signal', 'frequency'])


        figure.show()

    print(f"Elapsed time: {time.time() - timer_start}") if timer else None

    return sample_signal, detected_energy_flags, detected_frequency_flags


