"""# Pipeline"""

def pipeline(
        year = YEAR,
        month = MONTH,
        day = DAY,

        # starting at 00h:25m:
        at_hour = AT_HOUR,
        at_minute = AT_MINUTE,

        # and with a 30-min duration:
        hours = HOURS,
        minutes = MINUTES,

        run_detections = True,
        plot_detections=True,
        detection_params = {
            "lowcut": 50,
            "highcut": 500,
            "window_size": 1024,
            "threshold": 0.05,
            "energy_threshold": 1.0,
        },

        run_model = False,
        model_sample_rate = MODEL_SAMPLE_RATE,
        sample_rate = SAMPLE_RATE,

        start_audio = None,
        seconds = 100,

        score_fn = score_fn,

        display_results = True,
    ):
    timer_start = time.time()
    results = {}

    # load audio
    print("Loading audio")
    signal, signal_seconds = load_audio(
        year,
        month,
        day,
        at_hour,
        at_minute,
        hours,
        minutes,
        sample_rate
    )
    results["signal"] = signal

    # resample
    print("Resampling")
    resampled_signal = resample(signal, sample_rate, model_sample_rate)
    results["resampled_signal"] = resampled_signal

    # detections
    if run_detections:
        detect = parse_detect_plot if plot_detections else parse_detect

        print("Detections")
        _, energy_flags, frequency_flags = detect(
            resampled_signal,
            start_seconds=start_audio,
            seconds=seconds,
            **detection_params,
        )
        results["energy_flags"] = energy_flags
        results["frequency_flags"] = full_detections

    # spectrogram and play audio
    if start_audio:
        print(f"Playing audio from {start_audio} seconds")
        plot_spectrogram_scipy(
            signal,
            sample_rate,
            width=24,
        )
        play_section(signal, start=start_audio, seconds=seconds)

    # model
    if run_model:
        print("Running model")
        score_values = run(resampled_signal, score_fn, model_sample_rate)
        results["score_values"] = score_values

        # plot results
        if display_results:
            print("Plotting results")
            plot_results(
                score_values,
                resampled_signal,
                scores_with_dots=True,
                scores_with_steps=True,
                scores_med_filt_size=3,
            )

    return results

